// useFetchProjects.js
import { useState } from "react";

function useFetchProjects() {
  const [count, setCount] = useState(0);

  let increment = setCount(count + 1);

  const decrement = () => {
    setCount(count - 1);
  };
  console.log(count)

  return (count, increment, decrement)
}

export default useFetchProjects;
